import React from 'react';
import Box from '@material-ui/core/Box';
import { spacing,sizing, borders } from '@material-ui/system';
import FormLabel from '@material-ui/core/FormLabel';
import Container from '@material-ui/core/Container';


export default class ArticleBox extends React.Component {


    render() {
        let article = this.props.article;
        return(
            <div>

                <Box width="90%" height="100px" border={1} borderColor="text.primary"    bgcolor="lightgray" >
                    <label color= "#000000" text-align = "center">{article.title}</label>
                    <span>{article.author}</span>
                    <span>{article.description}</span>
                    <span>{article.content}</span>




                </Box>


                </div>



        )}

}
